test_list_of_tens:
assert {2} == {2, 5}
  Extra items in the right set:
  5
  Full diff:
  - {2, 5}
  + {2}

test_list_of_primes:
assert set() == {2}
  Extra items in the right set:
  2
  Full diff:
  - {2}
  + set()

test_powers_of_two:
assert {2, 4, 367, 734} == {2}
  Extra items in the left set:
  4
  734
  367
  Full diff:
  - {2}
  + {2, 4, 734, 367}
